import React, { Component } from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom"

import './App.css';

import Home from './containers/Home/index.js'

class App extends Component {
    render(){
        return(
            <div className="App">
              <Router>
                  <Route exact path="/" component={Home} />
              </Router>
            </div>
        );
    }
}
export default App;
